import React from 'react';
import './button1.css'

const button = () => {


    return(

        <button class="learn-more">
            <span class="circle" aria-hidden="true">
            <span class="icon arrow"></span>
            </span>
            <span class="button-text"></span>
        </button>
    );
}

export default button;
